import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Questionnaire() {
  const navigate = useNavigate();
  const [answers, setAnswers] = useState({
    location: "",
    aircon: "",
    price: "",
    type: "",
  });

  const handleChange = (e) => {
    setAnswers({ ...answers, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate("/results", { state: answers });
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-purple-200 to-indigo-300">
      <form
        onSubmit={handleSubmit}
        className="bg-white shadow-xl p-10 rounded-xl w-full max-w-lg space-y-6"
      >
        <h2 className="text-3xl font-bold text-purple-700">Your Preferences</h2>

        <div>
          <label className="block font-medium mb-1">Location</label>
          <select
            name="location"
            value={answers.location}
            onChange={handleChange}
            className="w-full border rounded p-2"
            required
          >
            <option value="">Select a location</option>
            <option value="Kuala Lumpur">Kuala Lumpur</option>
            <option value="Penang">Penang</option>
            <option value="Johor Bahru">Johor Bahru</option>
          </select>
        </div>

        <div>
          <label className="block font-medium mb-1">Air-Conditioning</label>
          <select
            name="aircon"
            value={answers.aircon}
            onChange={handleChange}
            className="w-full border rounded p-2"
            required
          >
            <option value="">Select</option>
            <option value="yes">Yes (Air-cond)</option>
            <option value="no">No (Outdoor/Fan only)</option>
          </select>
        </div>

        <div>
          <label className="block font-medium mb-1">Price Range</label>
          <select
            name="price"
            value={answers.price}
            onChange={handleChange}
            className="w-full border rounded p-2"
            required
          >
            <option value="">Select</option>
            <option value="budget">RM10–RM20</option>
            <option value="medium">RM20–RM50</option>
            <option value="premium">RM50+</option>
          </select>
        </div>

        <div>
          <label className="block font-medium mb-1">Type of Japanese Food</label>
          <select
            name="type"
            value={answers.type}
            onChange={handleChange}
            className="w-full border rounded p-2"
            required
          >
            <option value="">Select</option>
            <option value="sushi">Sushi</option>
            <option value="ramen">Ramen</option>
            <option value="bento">Bento</option>
            <option value="any">Any</option>
          </select>
        </div>

        <button
          type="submit"
          className="w-full bg-purple-600 hover:bg-purple-700 text-white py-3 rounded text-lg"
        >
          See Recommendations
        </button>
      </form>
    </div>
  );
}
